var getMonthName = function (e) {
    var t = [];
    return t[0] = "January",
        t[1] = "February", t[2] = "March",
        t[3] = "April",
        t[4] = "May",
        t[5] = "Jun",
        t[6] = "July",
        t[7] = "August",
        t[8] = "September",
        t[9] = "October",
        t[10] = "November",
        t[11] = "December", t[e]
},
    getDate = function (e) {
        var t = new Date(e),
            r = t.getDate(),
            o = t.getMonth() + 1,
            i = t.getFullYear();
        return r < 10 && (r = "0" + r),
            o < 10 && (o = "0" + o),
            t = i + "-" + o + "-" + r
    }
