    handleVisitorsVectorMap = function () {
        0 !== $("#users-map").length && $("#users-map").vectorMap({
            map: "world_merc_en",
            scaleColors: ["#eee", "#000"],
            container: $("#users-map"),
            normalizeFunction: "linear",
            hoverOpacity: .5,
            hoverColor: !1,
            markerStyle: {
                initial: {
                    fill: "#333", stroke: "transparent",
                    r: 3
                }
            },
            regions: [{
                attribute: "fill"
            }],
            regionStyle: {
                initial: { fill: "#777", "fill-opacity": 1, stroke: "none", "stroke-width": .4, "stroke-opacity": 1 }, hover: { "fill-opacity": .8 }, selected: { fill: "yellow" }, selectedHover: {}
            },
            series: {
                regions: [{ values: { IN: "#007aff", US: "#007aff", KR: "#007aff" } }]
            },
            focusOn: { x: .5, y: .5, scale: 2 },
            backgroundColor: "#222"
        })
    },

    DashboardV2 = function () {
        "use strict";
        return {
            init: function () {
                handleVisitorsLineChart(),
                    handleVisitorsDonutChart(),
                    handleVisitorsVectorMap(),
                    handleDashboardGritterNotification()
            }
        }
    }();